import { ActionTypes } from "../contants/action-types"

const initialState = {
    stocks: [],
}

export const stockReducer = (state = initialState, {type,payload}) => {

    switch (type) {
        case ActionTypes.SET_STOCKS:
            return state;
        default:
            return state;
    }
}
